new ChannelListener<StreamConnection>(){
  @Override public void handleEvent(  StreamConnection connection){
    handleConnected(connection,listener,uri,ssl,bufferPool,options);
  }
}

new IoFuture.Notifier<StreamConnection,Object>(){
  @Override public void notify(  IoFuture<? extends StreamConnection> ioFuture,  Object o){
    if (ioFuture.getStatus() == IoFuture.Status.FAILED) {
      listener.failed(ioFuture.getException());
    }
  }
}
